import React from 'react';
//import signinimage from '../images/minimal_standing_desk.svg';
import './Signup.css';
import 'bootstrap/dist/css/bootstrap.css';

const Signup =() => {
    return(
        <div>
            <div className="shadow-box-example z-depth-5">
            <section className={'signup'}>
                <div className={'container mt-5 '}>
                    <div className={'signup-content'}>
                        <div className="row">
                            <div className="col-sm-6">
                                <div className="card">
                                    <div className="card-body">
                                        <h4 className="card-title">SIGN UP!</h4>
                                        <p className="card-text">With supporting text below as a natural lead-in to
                                            additional content.</p>
                                        <a href="#" className="btn btn-outline-secondary">Go somewhere</a>
                                        <div className={'signup-image'}>
                                            {/*<img src={require('../images/minimal_standing_desk.svg')} alt={''} />*/}
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
            </div>
        </div>
    )
}

export default Signup;
